  null,\n\t\"notes\": \"Land Use 2010 is a parcel based, land use map representing
  land use conditions for the City of Austin and surrounding areas. Previous studies
  were made in 1990, 1995, 2000 and 2003. The 2010 study area included all of Travis
  County and parts of Hays, Williamson, Bastrop and Blanco Counties. Land use parcel
  geometry was based on the City of Austin's 2003 Land Use Study and City of Austin
  base map or county appraisal district GIS and CAD files. Historical land use data
  from previous studies, especially 2003, county tax appraisal district information,
  aerial photographs or other land-use related information was used to characterize
  the 2010 land uses. City of Austin staff, local planning or engineering consultants,
  researchers, students or area residents can use land use data for water resource
  research, planning, management, infrastructure and transportation planning, development,
  comprehensive or neighborhood planning and spatial analysis. Specifically the 2010
  land use layer can be used to study land use change and development patterns and
  as an input to water quality, flood, erosion or transportation models. The following
  includes some, but not all data limitations: \"Land use is current as of approximately
  September, 2010\", \"Parcels along the study area boundary may represent only a
  portion of the original\", \"Parcels adjacent to area lakes differ from those in
  the 2003 Land Use Study,\" \"Land use polygons may differ from tax appraisal district
  parcels\", \"Corrections to the original 2010 Land Use Study will be shown in periodic
  updates\", and \"Methods used to characterize land use in the latest study differ
  from previous studies and may not be directly comparable.\" This product has been
  produced by the Communications and Technology Department for the sole purpose of
  geographic reference. No warranty is made by the City of Austin regarding specific
  accuracy or completeness.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
